import React from 'react'
import DecktopIcon from './DesktopIcon/DecktopIcon';
import { NavLink } from 'react-router-dom';
import FolderIcon from "../../../Images/FolderIcon.png"
import MyComputerIcon from "../../../Images/MyComputer.png"
import s from "./Navbar.module.css";
import { useState } from 'react';

const Navbar = () => {

    let [SelectedItem, SetSelectedItem] = useState(0);

    function newChoose(el) {
        console.log(el)
        SetSelectedItem(el);
    }

    return (
        <div className={ s.Navbar }>
            <div onClick={ () => newChoose(1) }>
                <DecktopIcon isCoosing={ SelectedItem == 1 } image = { MyComputerIcon } name = {"Об олимпиаде"}/>
            </div>
            <div onClick={ () => newChoose(2) }>
                <DecktopIcon onClick={ () => newChoose(2) }  isCoosing={ SelectedItem == 2 } image = { FolderIcon } name = {"Направления"}/>
            </div>
            <div onClick={ () => newChoose(3) }>
                <DecktopIcon isCoosing={ SelectedItem == 3 } image = { FolderIcon } name = {"Этапы"}/>
            </div>
            <DecktopIcon onClick={ () => newChoose(4) }  isCoosing={ SelectedItem == 4 } image = { FolderIcon } name = {"Спонсоры"}/>
            <DecktopIcon onClick={ () => newChoose(5) }  isCoosing={ SelectedItem == 5 } image = { FolderIcon } name = {"Регстрация"}/>
        </div>
    );
}


export default Navbar;
